import React from 'react';

const MenuItem = ({ title, imageUrl, size }) => {
	return (
		<div className="menu-item">
			<div className="content">
				<h1 className="title">{title}</h1>
				<span className="subtitle">SHOP</span>
			</div>
		</div>
	);
};

export default MenuItem;
